export declare enum InviteValidationStatus {
    Success = 200,
    NoInviteFound = 404,
    Expired = 410,
    EmailNotAMatch = 403
}
export declare type InviteValidationResponse = {
    status: InviteValidationStatus.NoInviteFound;
    success: false;
} | {
    status: InviteValidationStatus.Expired;
    success: false;
    validTimeout: false;
} | {
    status: InviteValidationStatus.Success;
    success: true;
    validTimeout: true;
    validEmail: null;
} | {
    status: InviteValidationStatus.EmailNotAMatch;
    success: false;
    validTimeout: true;
    validEmail: false;
} | {
    status: InviteValidationStatus.Success;
    success: true;
    validTimeout: true;
    validEmail: true;
    destinationPath: string;
};
